import "./App.css";
import React from "react";
import bg from "./images/bg.jpg";

function Moonproject() {
  return <div>#MoonProject</div>;
}

function App() {
  return (
    <div className="App">
      <div className="appbackground"></div>
      <div className="sliderbackground"></div>
    </div>
  );
}

export default App;
